          <p>\u0420\u0430\u0441\u0448\u0438\u0440\u0435\u043D\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u0440\u0444\u0435\u0439\u0441, \u043E\u043D \u0436\u0435 \u0411\u0438\u0440\u0436\u0430, \u2014 \u044D\u0442\u043E \u043F\u043E\u043B\u043D\u043E\u0446\u0435\u043D\u043D\u0430\u044F \u0442\u043E\u0440\u0433\u043E\u0432\u0430\u044F \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0430 \u0441 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u0430\u043C\u0438 \u0434\u043B\u044F \u0442\u0440\u0435\u0439\u0434\u0438\u043D\u0433\u0430. \u041E\u043D\u0430 \u0441\u043E\u0441\u0442\u043E\u0438\u0442 \u0438\u0437 7 \u0431\u043B\u043E\u043A\u043E\u0432:</p>
