          <li>\xAB\u0418\u0441\u0442\u043E\u0440\u0438\u044F \u043E\u0431\u043C\u0435\u043D\u043E\u0432\xBB (\u0432\u043D\u0438\u0437\u0443) \u2014 \u0434\u043B\u044F \u0443\u0447\u0435\u0442\u0430 \u0432\u0441\u0435\u0445 \u0432\u0430\u0448\u0438\u0445 \u043E\u043F\u0435\u0440\u0430\u0446\u0438\u0439 \u043F\u043E \u043E\u0431\u043C\u0435\u043D\u0443 \u0441 \u0443\u043A\u0430\u0437\u0430\u043D\u0438\u0435\u043C \u0434\u0430\u0442\u044B, \u043A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u043E\u0442\u0434\u0430\u043D\u043D\u043E\u0439 \u0438 \u043F\u043E\u043B\u0443\u0447\u0435\u043D\u043D\u043E\u0439 \u0432\u0430\u043B\u044E\u0442\u044B, \u0446\u0435\u043D\u044B.</li>
